import React, { useState } from "react";
import "./projects.css";
import Website1 from "../../assets/website1.png";
import Website2 from "../../assets/website2.png";
import Website3 from "../../assets/website3.png";
import Website4 from "../../assets/website4.png";
import Website5 from "../../assets/website5.png";
import Website6 from "../../assets/website6.png";
import Website7 from "../../assets/website7.png";
import Website8 from "../../assets/website8.png";
import Website9 from "../../assets/website9.png";
import Website10 from "../../assets/website10.png";
import Website11 from "../../assets/website11.png";
import Website12 from "../../assets/website12.png";

const Websites = [
  {
    id: 1,
    image: Website1,
    title: "Jerome Laxale MP",
    category: "Personal",
  },
  {
    id: 2,
    image: Website2,
    title: "Spa Moment",
    category: "Ecommerce",
  },
  {
    id: 3,
    image: Website3,
    title: "La Peau",
    category: "Ecommerce",
  },
  {
    id: 4,
    image: Website4,
    title: "The Killer Coffee Co.",
    category: "Ecommerce",
  },
  {
    id: 5,
    image: Website5,
    title: "Vie Vie S",
    category: "Ecommerce",
  },
  {
    id: 6,
    image: Website6,
    title: "NB Skin",
    category: "Ecommerce",
  },
  {
    id: 7,
    image: Website7,
    title: "Seymour Building Supplies",
    category: "Business",
  },
  {
    id: 8,
    image: Website8,
    title: "Geyer",
    category: "Business",
  },
  {
    id: 9,
    image: Website9,
    title: "Corner Bar",
    category: "Business",
  },
  {
    id: 10,
    image: Website10,
    title: "Product of Italy",
    category: "Business",
  },
  {
    id: 11,
    image: Website11,
    title: "Calabria Club",
    category: "Business",
  },
  {
    id: 12,
    image: Website12,
    title: "OC Skin",
    category: "Business",
  },
];

const Projects = () => {
  const [items, setItems] = useState(Websites);
  return (
    <section className="projects container section" id="projects">
      <h2 className="section-title">- Projects</h2>
      <p className="des">
        (created by WordPress, and customised by html, css, and jQuery)
      </p>
      <div className="projects-filter">
        <span className="projects-item">Everything</span>
        <span className="projects-item">Personal Websites</span>
        <span className="projects-item">Ecommerce Websites</span>
        <span className="projects-item">Business Websites</span>
      </div>

      <div className="projects-container grid">
        {items.map((element) => {
          return (
            <div className="projects-card" key={element.id}>
              <div className="projects-thumbnail">
                <img src={element.image} className="projects-img" />
              </div>

              <a href="#" className="projects-button">
                {element.title}
              </a>
            </div>
          );
        })}
      </div>
    </section>
  );
};

export default Projects;
